    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIAutopilotV1QueryApi::listQueryCallback);
    connect(this, &OAIAutopilotV1QueryApi::abortRequestsSignal, worker, &QObject::deleteLater);
